import React, { useState, useEffect } from 'react';
import styles from './SuperAdminReports.module.css';

// Sample dummy data
const dummyRequests = [
  { id: 101, resident: 'Siva Prasad', service: 'Plumbing', status: 'Completed', isDelayed: false },
  { id: 102, resident: 'Vaishnavi', service: 'Electricity', status: 'Pending', isDelayed: true },
  { id: 3, resident: 'Arya Krishna', service: 'Water Supply', status: 'Completed', isDelayed: false },
  { id: 4, resident: 'Akash', service: 'Cleaning', status: 'Pending', isDelayed: true },
];

const totalResidents = 10; 
const SuperAdminReports = () => {
  const [requests, setRequests] = useState([]);
  const [showDelayed, setShowDelayed] = useState(false);

  useEffect(() => {
    setRequests(dummyRequests);
  }, []);

  const totalRequests = requests.length;
  const completedRequests = requests.filter(req => req.status === 'Completed').length;
  const pendingRequests = requests.filter(req => req.status === 'Pending').length;
  const delayedRequests = requests.filter(req => req.isDelayed);

  return (
    <div className={styles.container}>
      <h2>Super Admin Reports</h2>

      <div className={styles.summaryCards}>
        <div className={styles.card}>
          <h4>Total Requests</h4>
          <p>{totalRequests}</p>
        </div>
        <div className={styles.card}>
          <h4>Completed</h4>
          <p>{completedRequests}</p>
        </div>
        <div className={styles.card}>
          <h4>Pending</h4>
          <p>{pendingRequests}</p>
        </div>
      </div>

      <div className={styles.delayedSection}>
        <h3>Delayed Requests</h3>
        <button className={styles.toggleButton} onClick={() => setShowDelayed(!showDelayed)}>
          {showDelayed ? 'Hide Delayed Requests' : 'Show Delayed Requests'}
        </button>
        {showDelayed && (
          <table className={styles.table}>
            <thead>
              <tr>
                <th>ID</th>
                <th>Resident</th>
                <th>Service</th>
                <th>Status</th>
              </tr>
            </thead>
            <tbody>
              {delayedRequests.map(req => (
                <tr key={req.id}>
                  <td>{req.id}</td>
                  <td>{req.resident}</td>
                  <td>{req.service}</td>
                  <td>{req.status}</td>
                </tr>
              ))}
            </tbody>
          </table>
        )}
      </div>

      <div className={styles.residentCount}>
        <h3>Total Registered Residents</h3>
        <p>{totalResidents}</p>
      </div>
    </div>
  );
};

export default SuperAdminReports;
